import React, { Component } from 'react';


//props: 
// name
// region
// season

class Display extends Component {
    state = {  } 
    render() { 
        return (
            /** of class flex-container-display */
            <React.Fragment>

                <h1 class="flex-item-display flex-item-display-1">{this.props.name}</h1>

                <div class="flex-item-display flex-item-display-2 flex-container-data">

                    <div class="region">
                        {this.props.region }
                    </div>
                    <div class="season">
                        { this.props.season }
                    </div>

                </div>
            </React.Fragment>

        );
    }
}

export default Display;
